import './navbar.css';
import Button from '@mui/material/Button';
import GitHubIcon from '@mui/icons-material/GitHub';

function NavBar(props) {
  const color = props.color;
  return (
    <>
      <nav>
        <div className="navCont align-center">
            <div>
              <Button variant="text" id="contact" className="nav-p" sx = {{fontSize : "14px", fontWeight: "900", color: {color}}}>Resume</Button>
              <Button variant="text" id="contact" className="nav-p" sx = {{fontSize : "14px", fontWeight: "900", color: {color}}}>Contact</Button>
              <Button variant="text" id="contact" className="nav-p" sx = {{fontSize : "14px", fontWeight: "900", color: {color}}}>Projects</Button>
              <Button variant="text" id="contact" className="nav-p" sx = {{fontSize : "14px", fontWeight: "900", color: {color}}}>Research</Button>
              <Button variant="text" id="contact" className="nav-p" sx = {{fontSize : "14px", fontWeight: "900", color: {color}}}>Arts</Button>
            </div>
            <GitHubIcon sx={{color: {color}, margin: "30px"}} className="nav-p" fontSize="large"/>
        </div>
      </nav>
    </>
  )
}

export default NavBar;
